const CatPic =()=>{
    return(
        <div>
            <img src="https://cataas.com/c" alt="A cat" width="500" height="600" loading="lazy"></img>
            <img src="./Images/logo.webp" alt="A cat" width="50" height="60" type="image/webp" loading="lazy"></img>
        </div>
    );
}

export default CatPic;
